    private int[] ConvertArray(byte[] tmp) {
        int[] xx = new int[tmp.length];

        for (int i = 0; i < tmp.length; i++) {
            // Transparenz
            if (tmp[i] == 5) {
                xx[i] = 0x00c0c0c0;
            } else {
                // Schwarzer Schatten
                if (tmp[i] == 10) {
                    xx[i] = 0xff000000;
                } else {
                    // Textfarbe
                    if (tmp[i] == 15) {
                        xx[i] = 0xff00ff00;
                    } else {
                        // Randfarbe
                        if (tmp[i] == 20) {
                            xx[i] = 0xff000000;
                        } else {
                            System.out.print("?");
                        }
                    }
                }
            }
        }

        return xx;
    }
